import  Container from "react-bootstrap/Container";
import squadPic from "../images/squadPic.jpg";

function Home() {
    return(
        <div className="App">
            <Container fluid>
                <img alt="Squad" src={squadPic}></img>
            </Container>
        </div>       
    )
}

export default Home;
